import React, { useState } from 'react';
import { Modal, Button, Table } from 'react-bootstrap';


const SplitResult = (props) => {
    return (
        <>
            <Modal show={props.show} aria-labelledby="contained-modal-title-vcenter" centered>
                <Modal.Header closeButton>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Modal heading
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    Result of your bill splitted
                    <Table striped bordered hover size="sm">
                        <thead>
                            <tr>
                                <th>#</th>
                                <th>First Name</th>
                                <th>Amount</th>
                            </tr>
                        </thead>
                        <tbody>
                            {[{ 
                                username: props.username, 
                                splitResult: props.splitResult 
                            }].map((elem, index) => {
                                return (
                                    <tr>
                                        <td>index</td>
                                        <td>{elem.username}</td>
                                        <td>{elem.splitResult}</td>
                                    </tr>
                                );
                            })}
                        </tbody>
                    </Table>
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="danger" onClick={props.onHide}>
                        Close
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
}


export default SplitResult;
